Photo by @amivitale // Wild elephants walk through the 850,000 acre Namunyak Wildlife Conservancy, next to @sararafoundation. Elephants are a highly social and emotional creature, living in tight, matrilineal groups. They show signs of grief and "and may revisit the bones of the deceased for years, touching them with their trunks," reports @natgeo.

Please follow @amivitale and @r.e.s.c.u.e to learn how to support elephants.

